import Button from '../Button';
import CategoryList from '../Types/Interface/Category-List.Interface';
interface Props{
  categoryList:CategoryList
  onClick:()=>void;
  active: boolean
  id: number
  category: string
  onClickCategory(event: React.MouseEvent<HTMLButtonElement>): void
}


//top3
const Tab=({categoryList,onClick,active,id,category,onClickCategory}:Props) =>{
  const {categoryName}=categoryList
  return (
    <div className='TabWrapper'>
<Button
          data-id={id}
          style={{
            backgroundColor: 'white',
            height: '80px',
            minWidth: '240px',
          }}
          onClick={onClickCategory}
          {...props}>
          {category}
        </Button>
      {categoryName}
    </div>
  )
}

export default Tab
